import React, { StrictMode } from 'react'
import {connect} from "react-redux";
import store from './../store'
//import actions
import {addToFav, delFromFav, addToHistory, delFromHistory} from './../Components/userInfo/userInfoAction'

function WishList(props) {
    return (
        <div>
             <thead>
                    <tr>
                        <th>Book Name</th>
                        <th>Wishlist</th>
                    </tr>
                </thead>
                <tbody>
                    {/* Wishlist */}
                    {props.wishlist.map((b)=>(
                        <tr>
                            <td>{props.titlefun(b).title}</td>
                            <td><button onClick={()=>props.rmwishlistbutton(b)}>Unmark Wishist</button></td>
                        </tr>
                    ))}
                </tbody>
        </div>
    )
}

export default WishList
